import React from 'react';
import { Nav, Navbar, Form, FormControl } from 'react-bootstrap';
import styled from 'styled-components';
import logo from '../images/logo.svg';


const Styles = styled.div`
  .navbar { background-color: #074b5a; }
  a, .navbar-nav, .navbar-light .nav-link {
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .navbar-brand {
    font-size: 1.4em;
    color: #9FFFCB;
    &:hover { color: white; }
  }
  // .form-center {
  //   position: absolute !important;
  //   left: 75%;
  //   right: 25%;
  // }
`;
export const NavigationBar = () => (

  // < Styles >
    <Navbar expand="lg" className='navbar'>
      <Navbar.Brand href="/">
        <img
          src={logo}
          width="30"
          height="30"
          className="d-inline-block align-top"
          alt="A"
        />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav variant="tabs" className="justify-content-end d-inline-block">

          <Nav.Item><Nav.Link href="/Home">{process.env.REACT_APP_APP_NAME}</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link href="/Home/TPage">CX</Nav.Link></Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  // </Styles >
)
